import React from "react";

const ReadBook = ({ book, onDeleteRead }) => {
  const { id, title, imageLinks, userRating } = book;

  return (
    <li>
      <img src={imageLinks?.thumbnail} alt={`${title} cover`} />
      <div>
        <h3>{title}</h3>
        <p>{userRating} stars</p>
      </div>
      <button onClick={() => onDeleteRead(id)}>Remove</button>
    </li>
  );
};

export default ReadBook;
